{"metadata":{"kernelspec":{"name":"ir","display_name":"R","language":"R"},"language_info":{"name":"R","codemirror_mode":"r","pygments_lexer":"r","mimetype":"text/x-r-source","file_extension":".r","version":"4.0.5"}},"nbformat_minor":4,"nbformat":4,"cells":[{"source":"<a href=\"https://www.kaggle.com/code/lukemiller1987/cs5565-assign-2?scriptVersionId=135718827\" target=\"_blank\"><img align=\"left\" alt=\"Kaggle\" title=\"Open in Kaggle\" src=\"https://kaggle.com/static/images/open-in-kaggle.svg\"></a>","metadata":{},"cell_type":"markdown"},{"cell_type":"code","source":"# This R environment comes with many helpful analytics packages installed\n# It is defined by the kaggle/rstats Docker image: https://github.com/kaggle/docker-rstats\n# For example, here's a helpful package to load\n\nlibrary(tidyverse) # metapackage of all tidyverse packages\n\n# Input data files are available in the read-only \"../input/\" directory\n# For example, running this (by clicking run or pressing Shift+Enter) will list all files under the input directory\n\nlist.files(path = \"../input\")\nBoston = read.csv(\"/kaggle/input/cs5565-datasets/ALL CSV FILES - 2nd Edition/Boston.csv\")\nWage = read.csv(\"/kaggle/input/cs5565-datasets/ALL CSV FILES - 2nd Edition/Wage.csv\")\nCollege = read.csv(\"/kaggle/input/cs5565-datasets/ALL CSV FILES - 2nd Edition/College.csv\")\n\n# You can write up to 20GB to the current directory (/kaggle/working/) that gets preserved as output when you create a version using \"Save & Run All\" \n# You can also write temporary files to /kaggle/temp/, but they won't be saved outside of the current session","metadata":{"_uuid":"051d70d956493feee0c6d64651c6a088724dca2a","_execution_state":"idle","execution":{"iopub.status.busy":"2023-07-04T14:11:00.005836Z","iopub.execute_input":"2023-07-04T14:11:00.007908Z","iopub.status.idle":"2023-07-04T14:11:00.087164Z"},"trusted":true},"execution_count":71,"outputs":[{"output_type":"display_data","data":{"text/html":"'cs5565-datasets'","text/markdown":"'cs5565-datasets'","text/latex":"'cs5565-datasets'","text/plain":"[1] \"cs5565-datasets\""},"metadata":{}}]},{"cell_type":"code","source":"library(leaps)\nlibrary(glmnet)\nlibrary(caret)\n","metadata":{"execution":{"iopub.status.busy":"2023-07-04T14:54:07.384711Z","iopub.execute_input":"2023-07-04T14:54:07.386904Z","iopub.status.idle":"2023-07-04T14:54:07.408205Z"},"trusted":true},"execution_count":98,"outputs":[]},{"cell_type":"markdown","source":"# 6.6 Exercises\n## Conceptual\n### 1. We perform best subset, forward stepwise, and backward stepwise selection on a single data set. For each approach, we obtain p + 1 models, containing 0, 1, 2,...,p predictors. Explain your answers:\n#### (a) Which of the three models with k predictors has the smallest training RSS?","metadata":{}},{"cell_type":"markdown","source":"# FIX ME","metadata":{}},{"cell_type":"markdown","source":"#### (b) Which of the three models with k predictors has the smallest test RSS?\n","metadata":{}},{"cell_type":"markdown","source":"# FIX ME","metadata":{}},{"cell_type":"markdown","source":"#### (c) True or False:\n##### i. The predictors in the k-variable model identified by forward stepwise are a subset of the predictors in the (k+1)-variable model identified by forward stepwise selection.","metadata":{}},{"cell_type":"markdown","source":"# FIX ME","metadata":{}},{"cell_type":"markdown","source":"##### ii. The predictors in the k-variable model identified by backward stepwise are a subset of the predictors in the (k + 1)- variable model identified by backward stepwise selection.","metadata":{}},{"cell_type":"markdown","source":"# FIX ME","metadata":{}},{"cell_type":"markdown","source":"##### iii. The predictors in the k-variable model identified by backward stepwise are a subset of the predictors in the (k + 1)- variable model identified by forward stepwise selection.","metadata":{}},{"cell_type":"markdown","source":"# FIX ME","metadata":{}},{"cell_type":"markdown","source":"##### iv. The predictors in the k-variable model identified by forward stepwise are a subset of the predictors in the (k+1)-variable model identified by backward stepwise selection.","metadata":{}},{"cell_type":"markdown","source":"# FIX ME","metadata":{}},{"cell_type":"markdown","source":"##### v. The predictors in the k-variable model identified by best subset are a subset of the predictors in the (k + 1)-variable model identified by best subset selection.","metadata":{}},{"cell_type":"markdown","source":"# FIX ME","metadata":{}},{"cell_type":"markdown","source":"### 2. For parts (a) through (c), indicate which of i. through iv. is correct. Justify your answer.\n#### (a) The lasso, relative to least squares, is:\n##### i. More flexible and hence will give improved prediction accuracy when its increase in bias is less than its decrease invariance.\n##### ii. More flexible and hence will give improved prediction accuracy when its increase in variance is less than its decrease in bias.\n##### iii. Less flexible and hence will give improved prediction accuracy when its increase in bias is less than its decrease in variance.\n##### iv. Less flexible and hence will give improved prediction accuracy when its increase in variance is less than its decrease in bias","metadata":{}},{"cell_type":"markdown","source":"# Fix me","metadata":{}},{"cell_type":"markdown","source":"#### (b) Repeat (a) for ridge regression relative to least squares.\n##### i. More flexible and hence will give improved prediction accuracy when its increase in bias is less than its decrease invariance.\n##### ii. More flexible and hence will give improved prediction accuracy when its increase in variance is less than its decrease in bias.\n##### iii. Less flexible and hence will give improved prediction accuracy when its increase in bias is less than its decrease in variance.\n##### iv. Less flexible and hence will give improved prediction accuracy when its increase in variance is less than its decrease in bias","metadata":{}},{"cell_type":"markdown","source":"# Fix me","metadata":{}},{"cell_type":"markdown","source":"#### (c) Repeat (a) for non-linear methods relative to least squares.\n##### i. More flexible and hence will give improved prediction accuracy when its increase in bias is less than its decrease invariance.\n##### ii. More flexible and hence will give improved prediction accuracy when its increase in variance is less than its decrease in bias.\n##### iii. Less flexible and hence will give improved prediction accuracy when its increase in bias is less than its decrease in variance.\n##### iv. Less flexible and hence will give improved prediction accuracy when its increase in variance is less than its decrease in bias","metadata":{}},{"cell_type":"markdown","source":"# Fix me","metadata":{}},{"cell_type":"markdown","source":"## Applied\n### 8. In this exercise, we will generate simulated data, and will then use this data to perform best subset selection.\n#### (a) Use the rnorm() function to generate a predictor X of length n = 100, as well as a noise vector ϵ of length n = 100.","metadata":{}},{"cell_type":"code","source":"set.seed(42)\nn=100\nX=rnorm(n)\nepsilon = rnorm(n)","metadata":{"execution":{"iopub.status.busy":"2023-07-04T12:26:46.032278Z","iopub.execute_input":"2023-07-04T12:26:46.034209Z","iopub.status.idle":"2023-07-04T12:26:46.067854Z"},"trusted":true},"execution_count":3,"outputs":[]},{"cell_type":"markdown","source":"#### (b) Generate a response vector Y of length n = 100 according to the model Y = β0 + β1X + β2X2 + β3X3 + ϵ, where β0, β1, β2, and β3 are constants of your choice.","metadata":{}},{"cell_type":"code","source":"beta0 = 2\nbeta1 = 3\nbeta2 = -1\nbeta3 = 0.5\nY = beta0 + beta1*X + beta2*X^2 + beta3*X^3 + epsilon","metadata":{"execution":{"iopub.status.busy":"2023-07-04T12:26:46.072241Z","iopub.execute_input":"2023-07-04T12:26:46.074606Z","iopub.status.idle":"2023-07-04T12:26:46.107202Z"},"trusted":true},"execution_count":4,"outputs":[]},{"cell_type":"markdown","source":"#### (c) Use the regsubsets() function to perform best subset selection in order to choose the best model containing the predictors X, X2,...,X10. What is the best model obtained according to Cp, BIC, and adjusted R2? Show some plots to provide evidence for your answer, and report the coefficients of the best model obtained. Note you will need to use the data.frame() function to create a single data set containing both X and Y .","metadata":{}},{"cell_type":"code","source":"#clean up formatting\n\nmy_df = data.frame(Y, X, X2 = X^2, X3=X^3, X4 = X^4, X5 = X^5, X6 = X^6, X7 = X^7, X8 = X^8, X9 = X^9, X10 = X^10)\nregfit.full = regsubsets(Y~., my_df, nvmax=10)\nreg.summary = summary(regfit.full)\nwhich.min(reg.summary$cp)\nwhich.min(reg.summary$bic)\nwhich.min(reg.summary$adjr2)\npar(mfrow=c(2,2))\nplot(reg.summary$cp, xlab=\"Number of Variables\", ylab=\"Cp\", type=\"l\")\npoints(which.min(reg.summary$cp), reg.summary$cp[which.min(reg.summary$cp)], col=\"red\", cex=2, pch=20)\nplot(reg.summary$bic, xlab=\"Number of Variables\", ylab=\"BIC\", type=\"l\")\npoints(which.min(reg.summary$bic), reg.summary$bic[which.min(reg.summary$bic)], col=\"red\", cex=2, pch=20)\nplot(reg.summary$adjr2, xlab=\"Number of Variables\", ylab=\"Adjusted R2\", type=\"l\")\npoints(which.max(reg.summary$adjr2), reg.summary$adjr2[which.max(reg.summary$adjr2)], col=\"red\", cex=2, pch=20)\ncoef(regfit.full, which.min(reg.summary$cp))\ncoef(regfit.full, which.min(reg.summary$bic))\ncoef(regfit.full, which.max(reg.summary$adjr2))\n\n","metadata":{"execution":{"iopub.status.busy":"2023-07-04T12:26:46.11226Z","iopub.execute_input":"2023-07-04T12:26:46.114712Z","iopub.status.idle":"2023-07-04T12:26:46.55771Z"},"trusted":true},"execution_count":5,"outputs":[{"output_type":"display_data","data":{"text/html":"5","text/markdown":"5","text/latex":"5","text/plain":"[1] 5"},"metadata":{}},{"output_type":"display_data","data":{"text/html":"5","text/markdown":"5","te