dict the number of applications received using the other variables in the College data set.\n#### (a) Split the data set into a training set and a test set.","metadata":{}},{"cell_type":"code","source":"row.names(College) <- College$X\nCollege$X <- NULL\nCollege$Private <- ifelse(College$Private == \"Yes\", 1, 0)\ntrain_size = floor(0.7 * nrow(College))\nset.seed(42)\ntrain_indices = sample(seq_len(nrow(College)), size = train_size)\ntrain = College[train_indices, ]\ntest = College[-train_indices, ]","metadata":{"execution":{"iopub.status.busy":"2023-07-04T13:48:33.111459Z","iopub.execute_input":"2023-07-04T13:48:33.113435Z","iopub.status.idle":"2023-07-04T13:48:33.147001Z"},"trusted":true},"execution_count":54,"outputs":[]},{"cell_type":"markdown","source":"#### (b) Fit a linear model using least squares on the training set, and report the test error obtained.","metadata":{}},{"cell_type":"code","source":"fit = lm(Apps ~ ., data = train)\nsummary(fit)\npredictions = predict(fit, newdata = test)\ntest_error = mean((test$Apps - predictions)^2)\nplot(test$Apps, predictions, xlab = \"True\", ylab = \"Predicted\", \n     main = \"True vs Predicted values: Linear Model\", col = \"blue\")\nabline(a = 0, b = 1)\n\nprint(paste0(\"Test Error: \", test_error))","metadata":{"execution":{"iopub.status.busy":"2023-07-04T13:55:12.908565Z","iopub.execute_input":"2023-07-04T13:55:12.912087Z","iopub.status.idle":"2023-07-04T13:55:13.237909Z"},"trusted":true},"execution_count":58,"outputs":[{"output_type":"display_data","data":{"text/plain":"\nCall:\nlm(formula = Apps ~ ., data = train)\n\nResiduals:\n    Min      1Q  Median      3Q     Max \n-2786.6  -421.5   -64.1   271.7  6834.9 \n\nCoefficients: (1 not defined because of singularities)\n              Estimate Std. Error t value Pr(>|t|)    \n(Intercept) -1.252e+03  4.656e+02  -2.689  0.00740 ** \nPrivate             NA         NA      NA       NA    \nAccept       1.353e+00  5.938e-02  22.794  < 2e-16 ***\nEnroll      -4.044e-01 